pragma solidity ^0.5.0;

contract User {
    ///////////
    //
    bytes10 public name; //bytes10
    string public imgUrl; //url
    string public message; //
    //
    bool gender; //0  1 
    uint64 phone; //
    uint64 qq; //QQ
    string email; //
    bytes32 location; //
    bytes32[] language; //
    bytes32[] hobby; //
    /////////////////

    //
    address owner;

    //
    address[] applyClubs; //
    //
    address[] myClubs;
    //myClubs
    address public tempAuth; //public

    //
    notification[] notices; //
    struct notification {
        string _type; //
        address from;
        string time; //string
        string message;
    }

    modifier onlyOwner {
        require(msg.sender == owner, "");
        _;
    }

    modifier onlyMyClubs {
        bool flag = false;
        for (uint256 i = 0; i < myClubs.length; i++) {
            if (myClubs[i] == msg.sender) {
                flag = true;
                break;
            }
        }
        if (!flag) {
            for (uint256 i = 0; i < applyClubs.length; i++) {
                if (applyClubs[i] == msg.sender) {
                    flag = true;
                    break;
                }
            }
        }
        require(flag, "");
        _;
    }

    modifier clubsOrSelf {
        bool flag = false;
        for (uint256 i = 0; i < myClubs.length; i++) {
            if (myClubs[i] == msg.sender) {
                flag = true;
                break;
            }
        }
        if (!flag) {
            for (uint256 i = 0; i < applyClubs.length; i++) {
                if (applyClubs[i] == msg.sender) {
                    flag = true;
                    break;
                }
            }
        }
        require(flag || msg.sender == owner, "");
        _;
    }
    ////////////////////

    event applyPassEvent(address club); //

    event newNotification(
        string mtype,
        address _from,
        string time,
        string message
    );

    /////////////////////

    /**

    */
    constructor(bytes10 _name, address _owner) public {
        name = _name;
        owner = _owner;
    }

    function setImgUrl(string memory _imgUrl) public onlyOwner {
        imgUrl = _imgUrl;
    }

    function setMessage(string memory _message) public onlyOwner {
        message = _message;
    }

    function setUserInfo(
        bool _gender,
        uint64 _phone,
        uint64 _qq,
        string memory _email,
        bytes32 _location,
        bytes32[] memory _language,
        bytes32[] memory _hobby
    ) public onlyOwner {
        gender = _gender;
        phone = _phone;
        qq = _qq;
        email = _email;
        location = _location;
        language = _language;
        hobby = _hobby;
    }

    /**

    interface
    */
    function getUserInfo()
        public
        view
        clubsOrSelf
        returns (
            bool _gender,
            uint64 _phone,
            uint64 _qq,
            string memory _email,
            bytes32 _location,
            bytes32[] memory _language,
            bytes32[] memory _hobby
        )
    {
        return (gender, phone, qq, email, location, language, hobby);
    }

    function newNotice(
        string memory mtype,
        address _from,
        string memory _time,
        string memory _message
    ) public {
        notices.push(
            notification({
                _type: mtype,
                from: _from,
                time: _time,
                message: _message
            })
        );

        emit newNotification(mtype, _from, _time, _message);
    }

    //ClubManagermyClubs
    function setTempAuth(address addr) public onlyOwner {
        tempAuth = addr;
    }

    function addClub(address club) public {
        require(msg.sender == owner || msg.sender == tempAuth, "");
        //
        for (uint256 i = 0; i < myClubs.length; i++) {
            if (myClubs[i] == club) {
                return;
            }
        }
        myClubs.push(club);
    }

    function addApplyClub(address club) public onlyOwner {
        for (uint256 i = 0; i < applyClubs.length; i++) {
            if (applyClubs[i] == club) {
                return;
            }
        }
        //applyClubs
        applyClubs.push(club);
    }

    function applyPass() public {
        //
        bool flag = false;
        uint256 index;
        for (uint256 i = 0; i < applyClubs.length; i++) {
            if (applyClubs[i] == msg.sender) {
                flag = true;
                index = i;
                break;
            }
        }
        require(flag, "");
        //myClubs
        myClubs.push(msg.sender);
        //
        applyClubs[index] = applyClubs[applyClubs.length - 1];
        applyClubs.pop();

        emit applyPassEvent(msg.sender);
    }

    function applyRefus() public {
        //
        bool flag = false;
        uint256 index;
        for (uint256 i = 0; i < applyClubs.length; i++) {
            if (applyClubs[i] == msg.sender) {
                flag = true;
                index = i;
                break;
            }
        }
        require(flag, "");
        //
        //
        applyClubs[index] = applyClubs[applyClubs.length - 1];
        applyClubs.pop();

        //
        emit newNotification("", address(this), "", "");
    }
}
